window.onload=()=>{document.querySelector("#roomSubmit").onclick=e=>{(async e=>{e.preventDefault(),console.log("Called!");const o=document.querySelector("#roomName").value,r=document.querySelector("#roomTheme").value,t=document.querySelector("#roomMembers").value;console.log("Name: "+o),console.log("Theme: "+r),console.log("Members: "+t);const n={name:o,theme:r,members:t},c=await fetch("/createRoom",{method:"POST",headers:{"Content-Type":"application/json"},body:JSON.stringify(n)}),l=await c.json();l.redirect&&(window.location=l.redirect),l.error&&console.log("ERROR: "+l.error)})(e)}};